pragma solidity >=0.6.0 <0.8.0;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/math/SafeMath.sol";
import "./QuallaBase.sol";

contract QuallaSubscription is QuallaBase {
    using SafeMath for uint256;

    constructor(string memory uri_, uint256 chainId_)
        QuallaBase(uri_, chainId_)
    {}

    // Mappings

    // BaseToken
    struct baseStruct {
        uint256 paymentValue;
        uint256 index;
        address paymentToken;
        address creator;
    }

    baseStruct[] public baseTokens;

    mapping(uint256 => uint256) public baseTokenToIndex;

    // This kinda blew up. Not sure if I should change to struct
    // mapping(uint256 => uint256) public tokenIdToPaymentValue;
    // mapping(uint256 => address) public tokenIdToPaymentToken;
    // mapping(uint256 => uint256) public tokenIdToNextIndex;
    // mapping(uint256 => address) public tokenIdToCreator;

    // SubToken
    struct subStruct {
        uint64 nextWithdraw;
        uint64 mintStamp;
        uint8 nonce;
    }

    subStruct[] public subTokens;

    mapping(uint256 => uint256) public subTokenToIndex;

    // mapping(uint256 => uint256) public tokenId_ToNextWithdraw;
    // mapping(uint256 => uint256) public tokenId_ToMintStamp;

    // Just for demo purposes. Only allowing 5 executions before burning
    // mapping(uint256 => uint256) public tokenId_ToExectuedNonce;

    // Public Functions

    // Minting
    function mintSubscription(
        address creator,
        uint256 amount,
        address paymentToken,
        uint256 paymentValue,
        uint8 v,
        bytes32 r,
        bytes32 s
    ) public {
        // verify signature
        _verifySignature(creator, "mint", v, r, s);

        // TODO: Require paymentToken be ERC20

        if (amount == 0) {
            amount = uint256(-1);
        }

        uint256 id = (tokenNonce << 128);

        baseTokens.push(baseStruct(paymentValue, 1, paymentToken, creator));

        baseTokenToIndex[id] = baseTokens.length - 1;

        // _pushTokenData(
        //     _asSingletonArray(id),
        //     creator,
        //     _asSingletonAddressArray(paymentToken),
        //     _asSingletonArray(paymentValue)
        // );

        _mint(creator, id, amount, "");

        tokenNonce++;

        // tokenIdToNextIndex[id] = 1;
    }

    function mintBatchSubscription(
        address creator,
        uint256[] memory amounts,
        address[] memory paymentTokens,
        uint256[] memory paymentValues,
        uint8 v,
        bytes32 r,
        bytes32 s
    ) public {
        _verifySignature(creator, "mint", v, r, s);

        // TODO: Require paymentTokens be ERC20

        uint256[] memory ids = new uint256[](amounts.length);

        for (uint256 i = 0; i < amounts.length; i++) {
            if (amounts[i] == 0) {
                amounts[i] = uint256(-1);
            }

            baseTokens.push(
                baseStruct(paymentValues[i], 1, paymentTokens[i], creator)
            );

            ids[i] = (tokenNonce << 128);

            baseTokenToIndex[ids[i]] = baseTokens.length - 1;

            tokenNonce++;
        }

        // _pushTokenData(ids, creator, paymentTokens, paymentValues);

        _mintBatch(creator, ids, amounts, "");
    }

    // Burning
    function burnSubscription(
        uint256 id,
        uint256 amount,
        uint8 v,
        bytes32 r,
        bytes32 s
    ) public {
        require(id & TYPE_NF_BIT == 0, "Qualla/Wrong-Token-Type");
        require(id & NF_INDEX_MASK == 0, "Qualla/Invalid-Subscription-Index");

        // address creator = tokenIdToCreator[id];

        _verifySignature(
            baseTokens[baseTokenToIndex[id]].creator,
            "burn",
            v,
            r,
            s
        );
        _burn(baseTokens[baseTokenToIndex[id]].creator, id, amount);
    }

    // Subscription
    function buySubscription(
        address subscriber,
        uint256 id,
        uint8 v,
        bytes32 r,
        bytes32 s
    ) public {
        require(id & TYPE_NF_BIT == 0, "Qualla/Wrong-Token-Type");
        require(id & NF_INDEX_MASK == 0, "Qualla/Invalid-Subscription-Index");

        require(
            IERC20(baseTokens[baseTokenToIndex[id]].paymentToken).balanceOf(
                subscriber
            ) > baseTokens[baseTokenToIndex[id]].paymentValue,
            "Qualla/Insufficient-Balance"
        );

        require(
            IERC20(baseTokens[baseTokenToIndex[id]].paymentToken).allowance(
                subscriber,
                address(this)
            ) > baseTokens[baseTokenToIndex[id]].paymentValue,
            "Qualla/Insufficient-Allowance"
        );

        _verifySignature(subscriber, "subscribe", v, r, s);

        uint256 id_ = id | baseTokens[baseTokenToIndex[id]].index;

        subTokens.push(subStruct(0, uint64(block.timestamp), 0));

        subTokenToIndex[id_] = subTokens.length - 1;

        // tokenId_ToMintStamp[id_] = block.timestamp;

        _burn(baseTokens[baseTokenToIndex[id]].creator, id, 1);
        _mint(subscriber, id_, 1, bytes(""));

        baseTokens[baseTokenToIndex[id]].index++;
        // tokenIdToNextIndex[id]++;

        // TODO: Add option for immediate execution, rolling vs monthly execution, etc.
        executeSubscription(id_, subscriber);
    }

    function unSubscribe(
        address subscriber,
        uint256 id_,
        uint8 v,
        bytes32 r,
        bytes32 s
    ) public {
        require(id_ & TYPE_NF_BIT == 0, "Qualla/Wrong-Token-Type");
        require(id_ & NF_INDEX_MASK > 0, "Qualla/Invalid-Subscription-Index");

        _verifySignature(subscriber, "unsubscribe", v, r, s);

        _burn(subscriber, id_, 1);
        _mint(
            baseTokens[baseTokenToIndex[id_ & NONCE_MASK]].creator,
            id_ & NONCE_MASK,
            1,
            bytes("")
        );
    }

    function executeSubscription(uint256 id_, address subscriber) public {
        require(id_ & TYPE_NF_BIT == 0, "Qualla/Wrong-Token-Type");
        require(id_ & NF_INDEX_MASK > 0, "Qualla/Invalid-Subscription-Index");
        require(_balances[id_][subscriber] == 1, "Qualla/Invalid-Subscriber");
        require(
            subTokens[subTokenToIndex[id_]].nextWithdraw < block.timestamp,
            "Qualla/Subscription-Not-Ready"
        );

        uint256 id = id_ & NONCE_MASK;
        // address creator = tokenIdToCreator[id];

        // only for demo purposes!
        // ------------------------------
        if (subTokens[subTokenToIndex[id_]].nonce >= 4) {
            _burn(subscriber, id_, 1);
            _mint(baseTokens[baseTokenToIndex[id]].creator, id, 1, bytes(""));
        } else {
            subTokens[subTokenToIndex[id_]].nonce++;
        }
        // ------------------------------

        // burn token in not enough funds or allowance
        if (
            IERC20(baseTokens[baseTokenToIndex[id]].paymentToken).allowance(
                subscriber,
                address(this)
            ) <
            baseTokens[baseTokenToIndex[id]].paymentValue ||
            IERC20(baseTokens[baseTokenToIndex[id]].paymentToken).balanceOf(
                subscriber
            ) <
            baseTokens[baseTokenToIndex[id]].paymentValue
        ) {
            _burn(subscriber, id_, 1);
            _mint(baseTokens[baseTokenToIndex[id]].creator, id, 1, bytes(""));
        }

        // _transfer tokens

        IERC20(baseTokens[baseTokenToIndex[id]].paymentToken).transferFrom(
            subscriber,
            master,
            baseTokens[baseTokenToIndex[id]].paymentValue.mul(fee).div(100)
        );

        IERC20(baseTokens[baseTokenToIndex[id]].paymentToken).transferFrom(
            subscriber,
            baseTokens[baseTokenToIndex[id]].creator,
            baseTokens[baseTokenToIndex[id]].paymentValue.mul(100 - fee).div(
                100
            )
        );

        // add month in seconds
        // tokenId_ToNextWithdraw[id_] += 2592000;

        // For demo purposes!
        subTokens[subTokenToIndex[id_]].nextWithdraw += 15;
    }

    // untested
    // function updateSubscriptionCreator(
    //     address newCreator,
    //     uint256 id,
    //     uint8 v,
    //     bytes32 r,
    //     bytes32 s
    // ) external {
    //     require(id & TYPE_NF_BIT == 0, "Qualla/Wrong-Token-Type");
    //     require(id & NF_INDEX_MASK == 0, "Qualla/Invalid-Subscription-Index");

    //     address oldCreator = tokenIdToCreator[id];

    //     _verifySignature(oldCreator, "update", v, r, s);

    //     ERC1155.safeTransferFrom(
    //         oldCreator,
    //         newCreator,
    //         id,
    //         ERC1155._balances[id][oldCreator],
    //         bytes("")
    //     );

    //     tokenIdToCreator[id] = newCreator;
    // }

    // // Internal Functions
    // function _pushTokenData(
    //     uint256[] memory id,
    //     address creator,
    //     address[] memory paymentToken,
    //     uint256[] memory paymentValue
    // ) internal {
    //     for (uint256 i = 0; i < id.length; i++) {
    //         tokenIdToPaymentValue[id[i]] = paymentValue[i];
    //         tokenIdToPaymentToken[id[i]] = paymentToken[i];
    //         tokenIdToCreator[id[i]] = creator;
    //     }
    // }
}

